&lt;BODY text=#000000 bgColor=#ffffff&gt;&lt;P&gt;APLICAÇÃO&lt;BR&gt;Indicado para áreas de manutenção industrial em geral, fabricas de motores, balanças, moveis de aço, maquinas, implementos agrícolas, eletrodomésticos, entre outros.&lt;/P&gt;
&lt;P&gt;DESCRIÇÃO&lt;BR&gt;Produto de textura diferenciada para aplicações em superfícies que necessitam nivelamento aparente, com excelente resistência, brilho e durabilidade.&lt;/P&gt;
&lt;P&gt;FERRAMENTAS NECESSÁRIAS&lt;BR&gt;Aplicação a revolver ou airless Produto não precisa ser diluído, já está na viscosidade de aplicação para manter sua textura na aplicação.&lt;/P&gt;
&lt;P&gt;&amp;nbsp;&lt;/P&gt;&lt;/BODY&gt;

&lt;BODY text=#000000 bgColor=#ffffff&gt;&lt;P&gt;APLICAÇÃO&lt;BR&gt;Para aplicações horizontais como ruas, avenidas, rodovias, pátios, estacionamentos entre outros ambientes que necessitem de sinalizações em geral&lt;/P&gt;
&lt;P&gt;DESCRIÇÃO&lt;BR&gt;De excelente aderência a todo tipo de pavimento com resistência as intempéries e luz ultra violeta.&lt;/P&gt;
&lt;P&gt;FERRAMENTAS NECESSÁRIAS&lt;BR&gt;Sua aplicação é feita com rolo ou equipamento automático rodoviário de pintura de pavimentações.&lt;/P&gt;&lt;/BODY&gt;

&lt;BODY text=#000000 bgColor=#ffffff&gt;&lt;P&gt;Kit contém: &lt;/P&gt;
&lt;P&gt;6 tintas preto cadilac pu &lt;/P&gt;
&lt;P&gt;6 endurecedor pu 225ml&lt;/P&gt;&lt;/BODY&gt;
